import { TextStyle, Page, Layout, EmptyState, FooterHelp, Link, Card, Stack, Heading } from '@shopify/polaris';
import { TitleBar, ResourcePicker } from '@shopify/app-bridge-react';
import { useState } from 'react';

const register = () => {
    return(
            <Page fullWidth={true}>
                <Layout>
                    <Layout.Section>
                        <Card>
                            <Stack>
                                <Heading element="h1">Registroa</Heading>
                            </Stack>
                        </Card>
                    </Layout.Section>
                </Layout>
            </Page>
    );
};
export default register;
